import React, { useState, useEffect } from "react";
import logo from "./logo.svg";
import "./App.css";
import axios from "axios";

function App() {
  return <div class="cover-container d-flex w-50 h-100 p-3 mx-auto flex-column ">
  <main class="px-3">
      <h1>Create new access code or use one!</h1>
      <div class="input-group">
          <input type="text" class="form-control" placeholder="code..." aria-label="code..."
                 aria-describedby="basic-addon2"/>
          <div class="input-group-append">
              <button class="btn btn-outline-secondary mx-2" type="button">Use Code</button>
          </div>
      </div>
      <button class="btn btn-outline-secondary m-3" type="button">New Code</button>
  </main>

  <footer class="mt-auto text-white-50">
      <p>corkboard by <a href="https://www.linkedin.com/in/cayanayy/" target="_blank" class="text-white">cayanay</a>.
      </p>
  </footer>
</div>;
}

export default App;
